import React from "react";

const PokemonPage = ({ currentSelectedPokemon, pokemonData }) => {
  console.log(pokemonData[currentSelectedPokemon]);
  return <>{pokemonData[currentSelectedPokemon].name}</>;
};

export default PokemonPage;
